import {useFocusRing} from 'react-aria'

import './App.css';
let { isFocusVisible, focusProps } = useFocusRing();

function Search(){

  return (
    <div style={{backgroundColor: isFocusVisible? "red" : "white", width: 1000}}>
      <input className="searchbar--input" type="text" {...focusProps} />
    </div>
  )
}

function App() {
  return (
    <div className="content">
      <Search/>
    </div>
  );
}

export default App;
